import React, { useState } from 'react';
import './GuestPage.css';
const GuestPage = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };
  return (
    <div className="GuestChatContainer">
      <div className="roomColumn">Current Rooms
      <body className="chatCSS">
      <button className="chatRoomButton" onClick={toggleMenu}>
  General Chat
  {isMenuOpen && (
    <div className="popup-menu">
      {/* Popup menu content */}
    </div>
  )}
</button>

      </body>
      </div>
      <div className="chatColumn">Current Chat</div>
      <div className="userColumn">Current Online</div>
    </div>
  );
};

export default GuestPage;
